import React from "react";
import { makeStyles, Drawer, List, ListItem, Divider, Card, Typography } from "@material-ui/core";

import styles from "../styles/AppDrawerStyle";

const useStyles = makeStyles(styles);

function AppDrawer(props) {

    const classes = useStyles();

    return (
        <React.Fragment>
            <Drawer
                open={props.open}
                anchor="left"
            >
                <List>
                    <ListItem>
                        <Typography>Future Survey</Typography>
                    </ListItem>
                </List>
                <Divider />
            </Drawer>
        </React.Fragment>
    );

}

export default AppDrawer;
